import React, { useState } from "react";
import axios from "axios";
import "./Login.css";

const Login = ({ isOpen, onRequestClose, isRegister, setIsLoggedIn }) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [name, setName] = useState("");
  const [passwordConfirmation, setPasswordConfirmation] = useState("");
  const [error, setError] = useState(null);
  const [successMessage, setSuccessMessage] = useState(null);

  if (!isOpen) {
    return null;
  }

  const handleLogin = async (e) => {
    e.preventDefault();
    setError(null);
    setSuccessMessage(null);

    try {
      const response = await axios.post("http://127.0.0.1:8000/api/login", {
        email,
        password,
      });
      setSuccessMessage("Giriş başarılı!");
      setIsLoggedIn(true);
      onRequestClose();
    } catch (error) {
      setError(error.response?.data.message || "Giriş hatalı.");
    }
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setError(null);
    setSuccessMessage(null);

    try {
      const response = await axios.post("http://127.0.0.1:8000/api/register", {
        name,
        email,
        password,
        password_confirmation: passwordConfirmation,
      });
      setSuccessMessage("Kayıt başarılı!");
      onRequestClose();
    } catch (error) {
      setError(error.response?.data.message || "Kayıt hatası.");
    }
  };

  return (
    <div className="section">
      <div className="container">
        <div className="row full-height justify-content-center">
          <div className="col-12 col-md-10 col-lg-8">
            <div className="card">
              <div className="card-header">
                <h5>{isRegister ? "Kayıt Ol" : "Giriş Yap"}</h5>
              </div>
              <div className="card-body">
                {error && <div className="alert alert-danger">{error}</div>}
                {successMessage && (
                  <div className="alert alert-success">{successMessage}</div>
                )}
                <form onSubmit={isRegister ? handleRegister : handleLogin}>
                  {isRegister && (
                    <div className="form-group">
                      <label htmlFor="name">İsim</label>
                      <input
                        type="text"
                        className="form-control"
                        id="name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                      />
                    </div>
                  )}
                  <div className="form-group">
                    <label htmlFor="email">E-posta</label>
                    <input
                      type="email"
                      className="form-control"
                      id="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="password">Şifre</label>
                    <input
                      type="password"
                      className="form-control"
                      id="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                    />
                  </div>
                  {isRegister && (
                    <div className="form-group">
                      <label htmlFor="password_confirmation">Şifreyi Onayla</label>
                      <input
                        type="password"
                        className="form-control"
                        id="password_confirmation"
                        value={passwordConfirmation}
                        onChange={(e) =>
                          setPasswordConfirmation(e.target.value)
                        }
                        required
                      />
                    </div>
                  )}
                  <button type="submit" className="btn btn-primary">
                    {isRegister ? "Kayıt Ol" : "Giriş Yap"}
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
